import React from "react";
import * as S from './styles'

//Components
import Header from "../../components/Header";
import Footer from '../../components/Footer'
import { useState, useEffect } from "react";

function QrCode() {
    return (
        <S.Container>
            <Header />

            <S.content>
                <h1>Capture</h1>
            </S.content>

            <Footer />
        </S.Container>
    )
}

export default QrCode;
